import React from 'react';

const Conversation = () => {
    return (
        <ListGroup variant="flush">
        {contacts.map(contact => (
          <ListGroup.Item key={contact.Email}>
            {contact.Name}
          </ListGroup.Item>
        ))}
      </ListGroup>
        
    );
};

export default Conversation;
